import React from 'react';
import { Link } from 'react-router-dom';
import ReactStars from 'react-stars';
function MainPageItemList({ item }) {
  return (
    <div className="container">
      <div className="row">
        <div className="col push-m1 s12 m12 push-s1 l12 push-l1">
          <div className="card horizontal hoverable">
            <div className="card-image">
              <img
                src="https://surlybikes.com/uploads/bikes/_medium_image/KarateMonkey_BK2042-2000x1333.jpg"
                alt="Product"
              />
            </div>
            <div className="card-stacked">
              <h5 className="header center" style={{}}>
                {item.name}
              </h5>
              <div className="card-content">
                <p>{item.description}</p>
                <div className="container" style={{ backgroundcolor: 'blue' }}>
                  <div className="row">
                    <div className="col m12 ">
                      {' '}
                      <ReactStars
                        count={5}
                        size={23}
                        color1={'#F6E8E0'}
                        color2={'#D84B59'}
                      />{' '}
                    </div>
                  </div>
                </div>
              </div>
              <div className="card-action">
                <Link to="/item/:id">More</Link>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default MainPageItemList;
